import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";
import pic1 from "./pics/fireplanet1.png";
import pic2 from "./pics/fireplanet2.PNG";

class App extends Component {
  constructor(props) {
    super(props);

    const artworks = [
      { id: 0, img: pic1, title: "Your Mom" },
      { id: 1, img: pic2, title: "Second pic" }
    ];

    this.state = { rows: [] };
    var artworkCards = [];
    artworks.forEach(artwork => {
      artworkCards.push(<p>title: {artwork.title}</p>);
    });
    this.state = { rows: artworkCards };
  }
  render() {
    return (
      <div className="App">
        <header className="toolbar">
          <ul>
            <li className="title">Cooper Hewitt</li>
            <li className="about">About</li>
          </ul>
        </header>
        <div class="contentContainer">{this.state.rows}</div>
      </div>
    );
  }
}

export default App;
